壁紙を貼りかえるための、施工道具です。<br>
壁紙を切るときにカッターガイドとしてお使い下さい。
<br>
<br>
仕様<br>
    ■高級ステン地ベラ（カッターガイド）<br>
    ■高級タイプのステンレス地ベラです。<br>
    ■柄は軽量で防水処理を施しています。<br>
<br>
