壁紙専用カッターとして造られた小刃専用カッターです。<br> 
壁紙施工の必需品です！  <br> 
<br> 
仕様<br> 
    ■壁紙専用カッターとして造られた小刃専用カッター。<br>
    ■特殊スライドとフロレス加工により刃先がぐらつかない<br>
    ■手にフィットしやすく、滑りにくいゴム付きです。<br>
    ■何度も刃を折り切れやすい状態でご使用下さい。<br>
    ■刃を折るときは、非常に危険ですのでご注意ください。<style type="text/css">
